using System;
using System.Collections.Generic;
using System.IO;
using System.Linq;


namespace AutoBenchmark {
    class Program {
        static void Main(string[] args) {
            loadRank();
            //PageGenerator.generateStatistics();

            if (args.Length == 3) { check(args[0], args[1], args[2]); return; }
            if (args.Length > 0) { help(); return; }

            Benchmark.run();
        }

        static void help() {
            Console.WriteLine("Usage: ThisExe ProblemName InputPath OutputPath");
            Console.Write("wherein: ProblemName := ");
            bool notFirst = false;
            foreach (var pn in BenchmarkCfg.Checkers.Keys) {
                if (notFirst) { Console.Write(" | "); }
                Console.Write(pn);
                notFirst = true;
            }
            Console.WriteLine();
        }

        static void check(string problemName, string inputPath, string outputPath) {
            if (!BenchmarkCfg.Checkers.ContainsKey(problemName)) { help(); return; }
            string[] input = File.ReadAllLines(inputPath);
            string output = File.ReadAllText(outputPath);
            Statistic s = new Statistic();
            BenchmarkCfg.Checkers[problemName](input, output, s);
            Console.WriteLine(inputPath + BenchmarkCfg.LogDelim + outputPath + BenchmarkCfg.LogDelim
                + s.obj + BenchmarkCfg.LogDelim + s.duration.ToString() + BenchmarkCfg.LogDelim + s.info);
        }

        static void loadRank() {
            BenchmarkCfg.rank = Util.Json.load<Rank>(CommonCfg.RankPath);
            //PageGenerator.generateMarkdowns(BenchmarkCfg.rank);
            //Leaderboard.loadFromLog(BenchmarkCfg.rank);

            Dictionary<string, Func<Problem>> generators = new Dictionary<string, Func<Problem>> {
                { ProblemName.GCP.ToString(), generateColoring },
                { ProblemName.PCP.ToString(), generatePCenter },
                { ProblemName.FJSP.ToString(), generateJobshop },
                { ProblemName.RWA.ToString(), generateRWA },
                { ProblemName.RPP.ToString(), generateRectPacking },
                { ProblemName.VRPTW2d.ToString(), generateVRPTW2d },
                { ProblemName.OARSMT.ToString(), generateOARSMT },
                { ProblemName.DFVSP.ToString(), generateDFVSP },
                { ProblemName.MCDSP.ToString(), generateMCDSP },
                { ProblemName.PECCP.ToString(), generatePECCP },
                { ProblemName.DARP2d.ToString(), generateDARP2d },
            };

            Action<string> gitAdd = (string filename) => {
                using (File.Create(filename)) { }
                Util.run("git", $"add {filename}");
            };

            foreach (var pn in Enum.GetNames(typeof(ProblemName))) {
                Problem p;
                if (BenchmarkCfg.rank.problems.ContainsKey(pn)) {
                    p = BenchmarkCfg.rank.problems[pn];
                } else {
                    p = generators[pn]();
                    BenchmarkCfg.rank.problems.Add(pn, p);
                    gitAdd(CommonCfg.rankMarkdownPath(pn));
                }

                BenchmarkCfg.leaderboards.TryAdd(pn, new Leaderboard());
                if (!BenchmarkCfg.leaderboards[pn].load(pn, p)) {
                    BenchmarkCfg.leaderboards[pn].records.Add(new Records {
                        author = "Best", date = "0", score = 0,
                        objs = Enumerable.Repeat(Problem.MaxObjValue, p.instanceNum).ToArray()
                    });
                    gitAdd(CommonCfg.rankCsvPath(pn));
                    gitAdd(CommonCfg.bestCsvPath(pn));
                }
            }

            if (!File.Exists(CommonCfg.QueuePath)) {
                Util.appendLine(CommonCfg.QueuePath, "| EventDate | Problem | Author | SubmissionDate | State |");
                Util.appendLine(CommonCfg.QueuePath, "| --------- | ------- | ------ | -------------- | ----- |");
                Util.run("git", "add " + CommonCfg.QueuePath);
            }

            //Util.run("git", "add " + CommonCfg.ReadMePath);
            //PageGenerator.gitSync();
        }

